member.example:
This sample shows how to call DefaultAsync with required parameters.

Query client = new BytesClient().GetQueryClient(apiVersion: "1.0.0");

Response response = await client.DefaultAsync(BinaryData.FromObjectAsJson(new Dictionary<string, object>()));
Console.WriteLine(response.Status);

